int Nodes::getNextNode(int node, bool whichSide) {
	int nextNode;
	if(whichSide == true)
		nextNode = (2*node + 1);
	else
		nextNode = (2*node);
	if (nextNode > 4095)
		nextNode += 10000;
	 return nextNode;
}
